generated_sparql:
PREFIX s223: <http://data.ashrae.org/standard223#>
PREFIX brick: <https://brickschema.org/schema/Brick/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?zoneLabel ?propLabel ?alc ?mpc WHERE {
  # Find zones (targets)
  ?zone a s223:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }

  # Properties associated with the zone
  ?zone s223:hasProperty ?prop .
  ?prop rdfs:label ?propLabel .

  # Determine writability; keep those that are not writable or have no writable flag
  OPTIONAL { ?prop brick:writable ?writable . }
  FILTER ( !BOUND(?writable) || ?writable = false )

  # Endpoint references for ALC and MPC, if present
  OPTIONAL { ?prop brick:endpoint ?alc . }
  OPTIONAL { ?prop brick:mpc_db_name ?mpc . }
}
ORDER BY ?zoneLabel ?propLabel
